import React from 'react'
import ProductList from '../ProductList'
import { useParams } from 'react-router-dom'

import { useSelector } from 'react-redux'

const SearchFeed = () => {

    const {search} = useParams()
    
    
  return (
    <>
    <div>
        {search}
        <h3></h3>
    </div>
    <div>
        <ProductList/>
    </div>
    </>
    
  )
}

export default SearchFeed
